import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import Layout from '../../components/Layout/Layout';


class App extends Component {
	render() {
		return (
			<Layout>
				<h1>Rick & Morty</h1>
				<p>

I've replaced them both as the de facto patriarch of your family and your universe. Your mom wouldn't have accepted me if I came home without you and your sister, so now you know the real reason I rescued you. I just took over the family, Morty! And if you tell your mom or sister I said any of this, I'll deny it, and they'll take my side because I'm a hero, Morty! And now you're gonna have to go and do whatever I say, Morty! Forever! An-and I-I-I'll go out and I'll find some more of that Mulan szechuan teriyaki dipping sauce, Morty! Th-b-because that's what this is all about Morty! Th-that's my one-armed man! I'm not driven by avenging my dead family, Morty, that was fake! I-I-I'm driven by finding that mcnuggut sauce! I want that Mulan mcnuggut sauce, Morty! That's my series arc, Morty! If it takes nine seasons, I want my mcnuggut dipping sauce szechuan sauce, Morty! That's what's gon-it's gonna take us all the way to the end, Morty! Season nine more seasons, Morty! Nine more seasons until I get that dipping szechuan sauce! For ninety-seven more years, Morty! I want that mcnuggut sauce Morty! They're not infinite universes left in sync with the show. I don't get it and I don't need to. Really, you're gonna pull that move? I guided your entire civilisation. 
Your people have a holiday named ricksgiving. They teach kids about me in school.
You're not gonna believe this, because it usually never happens, but I made a mistake. 
Oh, it gets darker, Morty. Welcome to the darkest year of our adventures. First thing that's different? No more dad, 
Morty. 
That just sounds like slavery with extra steps. Please god, oh lord, hear my prayers…! YES! Fuck you god, 
not today bitch!
Nice, Mrs Pancakes. Real nice. I know the two of you are very different from each other in a lot of ways, 
but you have to understand that as far as Grandpa's concerned, you're both pieces of shit! Yeah. 
I can prove it mathematically. Actually, l-l-let me grab my whiteboard. 
This has been a long time coming, anyways. It's called carpe diem Morty. Look it up.
 Let’s be post-apocalyptic scavengerrrrsss!
Don't break an arm jerking yourself off Morty. Oh my god, how could I not see this coming? 
My lust, my greed! I deserve thiiiiii- Ladies, let's get out of here. 
I haven't learned a thiiiiiing! It probably has space aids. You're talking about Inception?
</p>
				<iframe src="https://giphy.com/embed/3oEduHUtBvTIIBosJq" width="480" height="270" frameBorder="0" class="giphy-embed" allowFullScreen></iframe><p><a href="https://giphy.com/gifs/rickandmorty-rick-and-morty-adult-swim02x04-3oEduHUtBvTIIBosJq"></a></p>
			</Layout>
		);
	}
}

export default App;
